CREATE SCHEMA shophoanganhsport ;
CREATE TABLE category (
  categoryid decimal primary key,
  categoryname varchar(45) default NULL,
  categoryimage longblob default null,
  chaid varchar(45) default null,
  ngaytao datetime,
  nguoitao varchar(45) default NULL,
  ngaysua datetime,
  nguoisua varchar(45) default NULL,
  daxoa int (11) NOT NULL DEFAULT 0
);

CREATE TABLE product (
  productid decimal primary key,
  productma decimal default null,
  productimage longblob default null,
  sanid int(11) default null,
  productprice int(11),
  productdescription varchar(500) default NULL,
  ngaytao datetime,
  nguoitao varchar(45) default NULL,
  ngaysua datetime,
  nguoisua varchar(45) default NULL,
  daxoa int (11) NOT NULL DEFAULT 0,
  chaid int(11) default null
);

CREATE TABLE info_customer(
	customerid decimal primary key,
	customername  varchar(100) default NULL,
    customerphone varchar(100) default NULL,
    customeraddress varchar(100) default NULL,
	orderdate datetime,
	ngaytao datetime, 
	nguoitao varchar(200) default NULL,
	ngaysua datetime, 
	nguoisua varchar(200) default NULL,
	daxoa int (11) NOT NULL DEFAULT 0,
    diaChiTinhId int (11) default NULL,
    diaChiHuyenId int (11) default NULL,
    diaChiXaId int (11) default NULL
);

CREATE TABLE bill(
	billid decimal primary key,
	customerid decimal,
	orderdate datetime,
	productid decimal,
    quantity int(11) default NULL,
	chaid decimal default null,
	ngaytao datetime, 
	nguoitao varchar(200) default NULL,
	ngaysua datetime, 
	nguoisua varchar(200)  default NULL,
	daxoa int (11) NOT NULL DEFAULT 0
);

CREATE TABLE donvihanhchinh (
  id decimal primary key,
  ma varchar(8) default null,
  ten varchar(150) default null,
  daxoa int(11) NOT null DEFAULT '0',
  chaid varchar(45) default null
) ;

CREATE TABLE IF NOT EXISTS `users`(
	`username` VARCHAR(45) NOT NULL ,
    `password` VARCHAR(45) NOT NULL ,
    `enabled` TINYINT NOT NULL DEFAULT 1 ,
    PRIMARY KEY (`username`)
);

CREATE TABLE IF NOT EXISTS `user_roles`(
	`user_role_id` int(11) NOT NULL AUTO_INCREMENT,
	`username` varchar(45) NOT NULL,
	`role` varchar(45) NOT NULL,
    PRIMARY KEY (`user_role_id`),
    FOREIGN KEY (`username`) references Users(`username`)
);

